import React from 'react';
import { Route, Switch,  } from 'react-router';
import { BrowserRouter } from 'react-router-dom';
import Signin from './LoginRegister/signin'
import Signup from './LoginRegister/signup';
import Homepage from "./Homepage/homepage";
import Profile from "./Dashboard/profile";
import Users from "./Dashboard/users/users";
import Newuser from "./Dashboard/users/newuser";
import Edituser from "./Dashboard/users/edituser";
import Shops from "./Dashboard/shops/shops";
import Newshop from "./Dashboard/shops/newshops";
import Editshop from "./Dashboard/shops/editshops";

function Routes() {

    return (

        <BrowserRouter>
            <Switch>
                <Route path="/signin" component={Signin} />
                <Route path="/signup" component={Signup} />
                <Route exact path="/" component={Homepage} />
                <Route exact path="/Home" component={Homepage} />
                <Route path="/profile" component={Profile} />
                <Route exact path="/users" component={Users} />
                <Route exact path="/users/add" component={Newuser} />
                <Route exact path="/users/edit/:id" component={Edituser} />
                <Route exact path="/shops" component={Shops} />
                <Route exact path="/shops/add" component={Newshop} />
                <Route exact path="/shops/edit/:id" component={Editshop} />
            </Switch>
        </BrowserRouter>

    )
}

export default Routes
